import React from 'react';
import './Home.css';
import Recents from './Recents';  // Recents bileşenini ekliyoruz

const Home = () => {
  // Proje verisini burada dinamik olarak alabilirsin
  const projects = [
    { id: 1, name: 'Project 1' },
    // Başka projeler ekleyebilirsin
  ];

  return (
    <div className="home-page">
      <h1>Good evening, Kaan</h1>
      <div className="grid-container">
        <Recents projects={projects} />  {/* Recents bileşenini burada kullan */}
        <div className="card">
          <h2>Agenda</h2>
          <p>Agenda items from your calendar will show here.</p>
          <button>Add calendar integrations</button>
        </div>
        <div className="card">
          <h2>My Work</h2>
          <p>Tasks and reminders assigned to you will show here.</p>
          <button>Add task or reminder</button>
        </div>
        <div className="card">
          <h2>Assigned to me</h2>
          <p>Tasks assigned to you will appear here.</p>
          <button>Add task</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
